import React from "react";
import ReactLogo from "../Components/ReactLogo";
import "../App.css";

export default function Header({ pageIndex, setPageIndex }) {
  const links = ["Profile", "About", "Testimonial", "Services", "Projects"];
  return (
    <div className="header">
      <div style={{ flex: 1, fontWeight: 600, fontSize: 40, display: "flex" }}>
        <div style={{ display: "flex", alignItems: "center" }}>
          <ReactLogo />
        </div>
        <div>
          <div style={{ height: 35 }}>erik</div>
          <div>larsson</div>
        </div>
      </div>
      {links.map((link, i) => {
        return (
          <div
            className={
              pageIndex === i
                ? "header-link header-link-active"
                : "header-link header-link-default"
            }
            onClick={() => setPageIndex(i)}
          >
            {link}
          </div>
        );
      })}
      <div style={{ flex: 1, display: "flex", justifyContent: "flex-end" }}>
        <i>CHAT</i>
      </div>
    </div>
  );
}
